import React from "react";
import { useMemo } from "react";
import checkPieces from "../../scripts/pieces";
import getFumenFromReplay from "../../scripts/upload";
import Setup from "../../components/Setup/Setup";
import Nav from "../../components/Nav/Nav";

const HomePage = () => {

    
    const setups = [
        {
            title: "Algebruh's 2nd Methods",
            author: "algebruh",
            methods: "29/35",
            setups: 40,
            cover: "100%",
            description: "This set is organized to minimize difficulty while maintaining reliability and usefulness."
        },
        {
            title: "2nd 100% T",
            author: "mkjl",
            methods: "21/35",
            setups: 882,
            cover: "0.11%",
            description: "This set contains every 2nd PC that has a 100% chance of saving into T 3rd."
        },
    ];

    return (
        <div>
            <Nav></Nav>
            {setups.map((setup, index) => (
                <Setup key={index} {...setup} />
            ))}
        </div>
    );
};

export default HomePage;
